        {
            VolumeFlow a = VolumeFlow.FromCubicMetersPerSecond(1);
            VolumeFlow b = VolumeFlow.FromCubicMetersPerSecond(2);

// ReSharper disable EqualExpressionComparison
            Assert.True(a == a);
            Assert.True(a != b);

            Assert.False(a == b);
